,"tags":[]},"source":["## 2. Prepare\n","\n","#### 2.1 Download data and store it appropirately.\n","\n","The data has been downloaded from this data source:  [Divvy Trip Data](https://divvy-tripdata.s3.amazonaws.com/index.html). Copies of the data has been securely stored on local drive, Kaggle and Google Drive.\n","\n","The data has been made available by Motivate International  Inc. under this  [license](https://ride.divvybikes.com/data-license-agreement).\n","\n","#### 2.2 Identify how it’s organized.\n","All the 12 trip data is in comma-delimited format with naming convention (yyyymm-divvy-tripdata.csv in its filename. \n","It has 13 columns with uniform naming conventions all throughout. \n","The datasets include(ride_id,rideable_type, start and end datetimes, start and end stations, geo-coordinates and membership type)\n","\n","#### 2.3 Determine the credibility of the data.\n","Since this case study uses public data,we can assume that the data is credible. The data is reliable, original, comprehensive, current, and cited.\n","\n","#### 2.4 Sort and ﬁlter the data.\n","For this analysis I'm going to extract, transform and load the dataset from 202109-202208. It will cover 1 year relevant bikeshare historical data for the business task. \n","\n","\n"]},{"cell_type":"code","execution_count":1,"id":"12372738","metadata":{"execution":{"iopub.execute_input":"2022-10-04T06:32:30.382905Z","iopub.status.busy":"2022-10-04T06:32:30.381438Z","iopub.status.idle":"2022-10-04T06:32:31.598389Z","shell.execute_reply":"2022-10-04T06:32:31.597159Z"},"papermill":{"duration":1.230656,"end_time":"2022-10-04T06:32:31.600481","exception":false,"start_time":"2022-10-04T06:32:30.369825","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001