e durations\n","\n","The filtered data shows zero and negative durations. As I noticed in the records with zero duration, The rented bike never left the station or travel for a few seconds and returned to the same station. The data shows all bikes are electric bikes. Those bikes probably has issues that needs troubleshooting.\n","\n","The negative durations with records that have different start and end stations are possibly interchanged. Also, most of the records have longer ride duration. The records with shorter ride duration mostly returned to their start stations.\n","\n","As I researched more on these irregularities, I found out that these entries occur when bikes were taken out of docks and checked for quality by Divvy so these ride durations must not be included in the analysis.\n","\n","Another concern is that there are lots of blanks in the start and end station names and start and end station ids. These untidy records must be removed for the analysis."]},{"cell_type":"code","execution_count":15,"id":"9fccde6a","metadata":{"execution":{"iopub.execute_input":"2022-10-04T06:35:25.699194Z","iopub.status.busy":"2022-10-04T06:35:25.69791Z","iopub.status.idle":"2022-10-04T06:36:14.971753Z","shell.execute_reply":"2022-10-04T06:36:14.970277Z"},"papermill":{"duration":49.296854,"end_time":"2022-10-04T06:36:14.978322","exception":false,"start_time":"2022-10-04T06:35:25.681468","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 20</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>ride_id</th><th scope=col>bike_type</th><th scope=col>started_at</th><th scope=col>ended_at</th><th scope=col>start_station_name</th><th scope=col>start_station_id</th><th scope=col>end_station_name</th><th scope=col>end_station_id</th><th scope=col>start_lat</th><th scope=col>start_lng</th><th scope=col>end_lat</th><th scope=col>end_lng</th><th scope=col>rider_type</th><th scope=col>date</th><th scope=col>year</