ider_type,bike_type,weekday) %>%\n","    summarise(totals=n(), .groups=\"drop\") %>%\n","ggplot(aes(x=weekday,y=totals, fill=bike_type)) +\n","  geom_col(, position = \"dodge\") + \n","  facet_wrap(~rider_type) +\n","  labs(title = \"Bike type usage by user type during a week\",x=\"User type\",y=\"Number of Rides (1e+05 =100,000)\",caption = \"Data by Motivate International Inc\") +\n","  scale_fill_manual(values = c(\"classic_bike\" = \"#746F72\",\"electric_bike\" = \"#FFB100\", \"docked_bike\" = \"#0000FF\")) +\n","  theme_minimal() +\n","  theme(legend.position=\"top\")"]},{"cell_type":"markdown","id":"09448c75","metadata":{"papermill":{"duration":0.025017,"end_time":"2022-10-04T06:46:49.190902","exception":false,"start_time":"2022-10-04T06:46:49.165885","status":"completed"},"tags":[]},"source":["The classic bikes are the most used bikes by both riders. Casual riders use all types of bikes while member riders use only classic and electric bikes. The least used bikes by casual riders is the docked bikes. The trends of the bikes used is similar with the rest of the trends wherein the members use the bikes heavily on weekdays while the casual riders use the bikes mostly on weekends."]},{"cell_type":"markdown","id":"2d08bf79","metadata":{"papermill":{"duration":0.027314,"end_time":"2022-10-04T06:46:49.243386","exception":false,"start_time":"2022-10-04T06:46:49.216072","status":"completed"},"tags":[]},"source":["### 5. Share\n","\n","Here is a summary of all the key findings in the analysis:\n","* Members use Cyclistic bikes more than Casual riders. They compose 59% of the total riders as compared with 41% of the casual riders.\n","* On average, casual riders ride the bikes longer than members. The average ride duration for casual is 25.99 mins which is more than twice as the members with 12.68 mins.\n","* The all time highs in using a bike is during the summer season.\n","* The most popular day to ride a bike is during Saturdays for casual riders and on Wednesdays for member riders.\n","* The bikes are mostly used throughout the day by both riders but it has a peak usage during 7-9am by member riders and 4-6pm by both riders.\n","* The top popular routes for members are from the residential area and going to the commercial area and vice versa while the casual riders ride usally in the center of the town.\n","* The mostly used bikes by both riders are the classic bikes and only the casual users use the docked bikes. This probably costs more than the other bikes.\n","\n","#### Conclusion: \n","##### The casual riders use the bikes mostly on weekends in the center of the town for leisure, tourism and exercise while the member riders use the bikes mostly during 7-9 am and 4-6pm going to and from work.\n","\n","\n","Note: The data visualizations were generated alongside with the analysis. I will importing the clean dataset to both Power BI and Tablaeu Public. I will be updating this case study.   "]},{"cell_type":"markdown","id":"f48c4b79","metadata":{"papermill":{"duration":0.025899,"end_time":"2022-10-04T06:46:49.295586","exception":false,"start_time":"2022-10-04T06:46:49.269687","status":"completed"},"tags":[]},"source":["### 6. Act\n","\n","The following will be my recommendations bases on the insights on the analysis:\n","* Considering the business task to convert casual riders into annual members, the analysis showed that casual riders have the purpose of riding for leisure, tourism and exercise therefore I can suggest that in order to convert the casual riders into annual members the company can do the following:\n","1. Exclusive Weekend Ride Membership: The team can create a leisure or exclusive weekend membership program at a lower price plan than the annual membership to welcome and attract casual riders.\n","2. Loyalty Program: The marketing team can create digital media ads or promos that focused on the casual users giving them rewards points. This can be accumulated by ride duration or number of rides. The accumulated rewards points can unlock membership basic features.\n","2. Further analysis: Data about residential, work locations and universities locations of casual riders can help to provide another perspective of data analysis."]},{"cell_type":"code","execution_count":36,"id":"f75f7c1e","metadata":{"execution":{"iopub.execute_input":"2022-10-04T06:46:49.349861Z","iopub.status.busy":"2022-10-04T06:46:49.348417Z","iopub.status.idle":"2022-10-04T06:47:47.52266Z","shell.execute_reply":"2022-10-04T06:47:47.521176Z"},"papermill":{"duration":58.203691,"end_time":"2022-10-04T06:47:47.524573","exception":false,"start_time":"2022-10-04T06:46:49.320882","status":"completed"},"tags":[]},"outputs":[],"source":["write.csv(all_trips_clean,\"C:\\\\Users\\\\franz\\\\Desktop\\\\alltrips.csv\", row.names = FALSE)"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":920.948556,"end_time":"2022-10-04T06:47:48.177201","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-10-04T06:32:27.228645","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}